import './index.css'
import Article from './Article'
const App = ()=>{
  const articles = [
    {title : "React js" , content :"React is a js framework"}
  ]
  const articleItems = articles.map((article , index) =>{
    return (
      <Article title={article.title} content={article.content} />
    )
  })
  return (
    <div className='App'>
        {articleItems}
    </div>
  )
}

export default App;
